    background: #cccccc;
    height: 0.2rem;
    margin: 2rem 0rem;
    width: 100%;
}
.question{
    padding: 3rem 0rem;
    cursor: pounter;
}
.answer{
    padding: 2rem 0rem;
}
p{
    padding: 1rem 0rem;
}
`;

export default FaqSection;
